  return (
    <div className="App">
      <header className="App-header">
        <h1>MARCH MADNESS IS UPON US!</h1>
        <p>Welcome to my site that lists out information about all the colleges in NCAA Basketball.</p>

      </header>
    </div>
  );
}

export default App;
